import React from "react";
import { Link } from "react-router-dom";

const ProjectCard = ({ project }) => {
  return (
    <>
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">{project.title}</h5>
          <p className="card-text"></p>
        </div>
      </div>
    </>
  );
};

export default ProjectCard;
